import styles from "./NavMenu.module.scss";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import Container from "react-bootstrap/Container";
import { NavLink } from 'react-router-dom';
const token = localStorage.getItem("food-token")
/* import { DiJqueryLogo } from 'react-icons/di'; */

const NavMenu = () => {
    return (

        <Navbar className={styles.Navbar} collapseOnSelect expand="lg" bg="<" variant="dark">
            <Container  >
                <Navbar.Brand className={styles.application} href="#">
                    <DiJqueryLogo className={styles.logo} />
                    our application
                </Navbar.Brand>

                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">

                    {token ? (
                        <Nav className="me-auto">

                            <NavLink className={styles.navItem} to="/">Home</NavLink>
                            <NavLink activeClassName={styles.active} className={styles.navItem} to="/nutrition-analysis">Nutrition analysis</NavLink>
                            <NavLink activeClassName={styles.active} className={styles.navItem} to="/recipes">Recipes</NavLink>
                            <NavLink activeClassName={styles.active} className={styles.navItem} to="/bmi">BMI</NavLink>
                            <NavLink activeClassName={styles.active} className={styles.navItem} to="/articles">Articles</NavLink>
                            <NavLink onClick={(e) => {
                                localStorage.removeItem('food-token')
                            }} activeClassName={styles.active} className={styles.navItem} to="/">Logout</NavLink>
                        </Nav>
                    ) : (
                        <Nav>
                            <NavLink activeClassName={styles.active} className={styles.navItem} eventKey={2} to="/login">Login</NavLink>
                            <NavLink activeClassName={styles.active} className={styles.navItem} to="/register">Register</NavLink>
                        </Nav>
                    )}

                    <Nav>
                        <NavLink activeClassName={styles.active} className={styles.login} eventKey={2} to="/login">Login</NavLink>
                        <NavLink activeClassName={styles.active} className={styles.register} to="/register">Register</NavLink>
                    </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>

    );
};

export default NavMenu;
